import React from 'react';

type TodolistType = {
    task:Array<TaskType>;
    name:string;
}

type TaskType = {
    id:string;
    title:string;
    isDone:boolean;
}

export const Todolist = (props:TodolistType) => {


    return (
        <div>
            <h3>{props.name}</h3>
            <input/>
            <button>Add</button>
          <div>
              {props.task.map((el)=>{
                  return (
                      <div>
                          <li  key={el.id}>
                              <input type={'checkbox'} checked={el.isDone}/>
                              <span>{el.title}</span>
                              <button>x</button>
                          </li>

                      </div>
                  )
              })}

<button>All</button>
          </div>
        </div>
    );
};
